import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <h1 className="Home__Navbar">MOONBOARD</h1>
        <div className="Home__Body">
          <div className="Home__Body__Article">
            <div className="Home__Body__Article__Title">
              <h2>Article Title</h2>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
